import Chart from "react-apexcharts";

const Donut = () => {
  return (
    <>
      <Chart
        type="donut"
        width={350}
        height={550}
        series={[23, 80]}
        options={{
          labels: ["student", "sunny"],
        }}
      ></Chart>
    </>
  );
};

export default Donut;
